import React, { useState } from "react";
import '../fw-cuisining.css'; // Relative path from pages folder

const Testing = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);

  const openModal = () => {
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };

  return (
    <>
      <div className="c-container">
        <h1 className="d-flex b-dashed justify-content-center align-items-center d-flex">
          Testing Page
        </h1>

        <div className="d-flex justify-content-center">
          <a href="#" className="cbtn cbtn-primary btn-lg">
            btn-lgasdasdasd
          </a>
        </div>

        {/* Button to open modal */}
        <button className="cbtn cbtn-primary" onClick={openModal}>
          Open Modal
        </button>

        {/* Modal */}
        {isModalOpen && (
          <div className="modal-overlay" style={{ display: 'flex' }}>
            <div className="modal">
              <div className="modal-header">
                <h5 className="modal-title">Modal Title</h5>
                <button className="modal-close" onClick={closeModal}>
                  Ã—
                </button>
              </div>
              <div className="modal-body">
                <p>Modal content goes here.</p>
              </div>
              <div className="modal-footer">
                <button className="cbtn cbtn-secondary" onClick={closeModal}>
                  Close
                </button>
                <button className="cbtn cbtn-primary">Okay</button>
              </div>
            </div>
          </div>
        )}
      </div>
    </>
  );
};

export default Testing;
